INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (1433842, 'La Meta es el Amor', 'Cuando la brillante productora de televisión Leah Caldwell (Kelly Rowland) está a punto de hacer historia como la primera mujer en dirigir el programa matutino más importante de Nueva York, su ex, Jarrett Roy (Clifford "Method Man" Smith), aparece para competir por el mismo puesto. Afirma ser un hombre diferente, transformado por la sabiduría del bestseller del New York Times, "Relationship Goals".Mientras su círculo íntimo de amigos se sumerge en el mismo libro transformador, todos comienzan a redescubrir su propósito en el amor. Sin embargo, Leah, completamente centrada en romper el techo de cristal, no está lista para creer en encontrar el amor, incluso cuando la innegable química con su ex amenaza con reavivar viejas llamas.', 'https://image.tmdb.org/t/p/original/eZRbRa0q9rKkPe0gfJ2a0NhygBX.jpg', 'https://image.tmdb.org/t/p/original/dFdFQaffaBNBNM5hzinc6Q0oWDZ.jpg', 'https://www.youtube.com/watch?v=m-dp6lQwGSI', 2026, 96);
